import React from 'react';
import './BugsSection.css';

const BugsSection = ({ data }) => {
  return (
    <div className="bugs-section">
      <div className="bugs-grid">
        <div className="bug-status-card abiertos">
          <div className="bug-status-title">Bugs Abiertos</div>
          <div className="bug-status-value">{data.bugsAbiertos}</div>
        </div>
        <div className="bug-status-card cerrados">
          <div className="bug-status-title">Bugs Cerrados</div>
          <div className="bug-status-value">{data.bugsCerrados}</div>
        </div>
        <div className="bug-status-card cancelados">
          <div className="bug-status-title">Bugs Cancelados</div>
          <div className="bug-status-value">{data.bugsCancelados}</div>
        </div>
      </div>
    </div>
  );
};

export default BugsSection;
